import React,{Component} from 'react';
import { MDBDataTable } from 'mdbreact';
import {withRouter,Route,Link} from 'react-router-dom';
import Daftarlogpintu from './daftarlogpintu';
import Editlogpintu from './editlogpintu';



class Logpintu extends Component{
  constructor(props) {
    super(props);
    this.state = {
      isidata: [],
      editID:'',
    };
  }

  componentDidMount(){
    fetch('http://192.168.2.7:8020/doorlog/getlogapi/', {
      method: 'post',
      headers :{
        "Authorization" : "Bearer "+ sessionStorage.name,
        "Content-Type" : "application/json"
      },
      body: JSON.stringify({
        sort_by: "nim",
        ascordsc: "asc",
        page_size: 5,
        page: 2,
        date_start: "2019-02-13",
        date_end:"2019-07-10"
      })
    })
    .then (response =>response.json())  
    .then (response =>this.setState({isidata:response.list}))
  }

  refresh(){
    fetch('http://192.168.2.7:8020/doorlog/getlogapi/', {
      method: 'post',
      headers :{
        "Authorization" : "Bearer "+ sessionStorage.name,
        "Content-Type" : "application/json"
      }
    })
    .then (response =>response.json())  
    .then (response =>this.setState({isidata:response.list}))
  }

  // deleteData(e,f){
