  //       if (response.ok){
  //         window.alert("Data berhasil dihapus")
  //       }
  //       else{
  //         window.alert("Data tidak berhasil dihapus")
  //       }
  //     })
  //   }
  // }

  editData(e){
    this.setState({editID:e})
  }

  render(){
    const {isidata,editID} = this.state
    var x = 1;
    return(
      <div>
          <div>
            <Switch>
              <Route path="/logpintu/daftar" render={ () => <Daftarlogpintu/> } />
              <Route path="/logpintu/edit" render={ () => <Editlogpintu editID={editID}/> } />
            </Switch>
          </div>
          <div className="box-footer">
              <div className="kotakdaftarruangan">
                <Link to="/logpintu/daftar">
                  <div className="daftar">
                    <i className="fa fa-plus"></i> 
                    <span> Ruangan </span>
                  </div>
                </Link>
                <span>
                  <a onClick={() => this.refresh()}>
                    <div className="daftar2">
                      <i className="fa fa-refresh"></i>
                    </div>
                  </a>
                </span>
              </div>
              <div>
                <table>
                  <thead>
                    <tr>
                      <th>No</th> 
                      <th>NIM</th>
                      <th>Nama</th>
                      <th>Kode Ruangan</th>
                      <th>Nama Ruangan</th>
                      <th>Tanggal</th> 
                      <th>Waktu</th>
                      <th>Status</th>
                      <th>Method</th>
                      <th>Edit</th>
                    </tr>
                  </thead>
                  <tbody>
                    {isidata.map(isi =>(
                      <tr key={isi.nim}>
                        <td>{x++}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>{isi.nim}</td>
                        <td>
                          <div className="editdelete"> 
                            <Link to="/logpintu/edit" onClick={() => this.editData(isi.nim)}>
                              <i className="fa fa-pencil"></i>
                            </Link>
                          </div>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div> 
          </div>
      </div>
    )
  } 
}

export default withRouter(Logpintu);
